const fixtures = {
  dependencyPlugin: {
    linux: '../fixtures/java-goof-mvn-dependency-plugin-output-line-feed.txt',
    darwin: '../fixtures/java-goof-mvn-dependency-plugin-output-line-feed.txt',
    win32:
      '../fixtures/java-goof-mvn-dependency-plugin-output-line-feed-and-carriage-return.txt',
  },
  mvnExec: {
    linux: '../fixtures/java-goof-mvn-exec-output-line-feed.txt',
    darwin: '../fixtures/java-goof-mvn-exec-output-line-feed.txt',
    win32:
      '../fixtures/java-goof-mvn-exec-output-line-feed-and-carriage-return.txt',
  },
};

describe('Output parsing', () => {
  test('parse mvn dependency plugin results', () => {
    const mvnOutput = fs.readFileSync(
      path.join(__dirname, fixtures['dependencyPlugin'][process.platform]),
      'utf-8',
    );
    expect(parseMvnDependencyPluginCommandOutput(mvnOutput)).toEqual(
      dependencyPluginClassPaths[process.platform],
    );
  });

  test('parse mvn exec results', () => {
    const mvnOutput = fs.readFileSync(
      path.join(__dirname, fixtures['mvnExec'][process.platform]),
      'utf-8',
    );
    expect(parseMvnExecCommandOutput(mvnOutput)).toEqual(
      execClassPaths[process.platform],
    );
  });
});

test('merging mvn class paths', () => {
  expect(
    mergeMvnClassPaths(dependencyPluginClassPaths[process.platform]),
  ).toEqual(mergedClassPath[process.platform]);
});

test('getMvnCommandArgsForMvnExec - gets the right mvn commands', () => {
  const targetPath = 'pathToClasspath';
  if (process.platform === 'win32') {
    expect(getMvnCommandArgsForMvnExec(targetPath)).toEqual([
      '-q',
      'exec:exec',
      '-Dexec.classpathScope="compile"',
      '-Dexec.executable="cmd"',
      '-Dexec.args="/c echo %classpath"',
      '-f',
      targetPath,
    ]);
  } else {
    expect(getMvnCommandArgsForMvnExec(targetPath)).toEqual([
      '-q',
      'exec:exec',
      '-Dexec.classpathScope="compile"',
      '-Dexec.executable="echo"',
      '-Dexec.args="%classpath"',
      '-f',
      targetPath,
    ]);
  }
});
